import React, { Component } from "react";

import CardNota from "../../components/CardNota/index.jsx";

class ListaDeNotas extends Component {
  render() {
    return (
      <ul>
        {Array.of("Trabalho", "Trabalho", "Estudo").map((categoria) => {
          return (
            <li key>
              <div>{categoria}</div>
            <CardNota />
          </li>
          );
        })}

      </ul>
    );
  }
}

export default ListaDeNotas;
